    totalPrice: function totalPrice() {
      var quantity = this.form.quantity;
      var unitPrice = this.form.unitPrice;
      var purchaseUnitPrice = this.form.purchaseUnitPrice;
      var purchaseTotalPrice = quantity * purchaseUnitPrice;
      this.form.purchaseTotalPrice = purchaseTotalPrice;

      if (this.form.discountPriceHidden == 0) {
        var totalPrice = quantity * unitPrice;
        this.form.totalPrice = totalPrice;
        this.form.totalDis = 0;
      } else {
        var _totalPrice = quantity * this.form.discountPriceHidden;

        var dis = unitPrice - this.form.discountPriceHidden;
        this.form.totalDis = quantity * dis;
        this.form.totalPrice = _totalPrice;
      }
    },
    totalCalculate: function totalCalculate(e) {
      var cashInput = parseFloat(this.form.currentPaidAmount);
      var bankInput = parseFloat(this.form.mobileAmount);

      if (cashInput == '' || isNaN(cashInput) || cashInput == 0) {
        cashInput = 0;
      } else {
        cashInput = cashInput;
      }

      if (bankInput == '' || isNaN(bankInput) || bankInput == 0) {
        bankInput = 0;
      } else {
        bankInput = bankInput;
      }

      var totalInput = parseFloat(cashInput + bankInput).toFixed(2);
      var inputDue = parseFloat(this.form.currentTotalAmount - totalInput).toFixed(2); // alert(totalInput);

      if (inputDue < 0.00) {
        if (e == 1) {
          this.form.currentPaidAmount = ''; // alert(bankInput);

          this.form.currentDue = parseFloat(this.form.currentTotalAmount - bankInput).toFixed(2);
        } else if (e == 2) {
          this.form.mobileAmount = '';
          this.form.currentDue = parseFloat(this.form.currentTotalAmount - cashInput).toFixed(2);
        }
      } else {
        this.form.currentDue = inputDue;
      }

      if (this.form.customerTypeId == 1) {
        this.generalCustomerDue(this.form.currentDue);
      } else {
        this.calculateDueLimit(this.form.currentDue);
      }
    },
